import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <nav class="navbar navbar-inverse">
        <a class="navbar-brand" href="#a">Title</a>
        <ul class="nav navbar-nav">
          <li class="active">
            <a href="#a">Home</a>
          </li>
          <li>
            <a href="#a">Link</a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default App;
